import React, { Component } from 'react';
import axios from 'axios';
class User extends Component {

    getData = () => {
        axios.get('http://localhost:8080/admin/user/allUser')
            .then(function (response) {
                // handle success
                console.log(response);
            })
            .catch(function (error) {
                // handle error
                console.log(error);
            })
            .finally(function () {
                // always executed
            });
    }
    render() {
        return (
            <>

            </>
        );
    }
}

export default User;
